/* This internal slot method is used to receive the corresponding signal form the 
   keyboard handler. */
void SteelRotaryKnob_onPressKeySlot( SteelRotaryKnob _this, XObject sender )
{
  XInt32 oldValue = _this->CurrentValue;
  XInt32 noOfSteps = _this->MaxValue - _this->MinValue;
  XInt32 step;

  if ( noOfSteps < 0 )
    noOfSteps = -noOfSteps;

  if ( noOfSteps > 100 )
    noOfSteps = 100;

  step = ( _this->MaxValue - _this->MinValue ) / noOfSteps;

  if ( sender == ((XObject)&_this->KeyHandlerUp ))
    SteelRotaryKnob_OnSetCurrentValue( _this, _this->CurrentValue + step );

  if ( sender == ((XObject)&_this->KeyHandlerDown ))
    SteelRotaryKnob_OnSetCurrentValue( _this, _this->CurrentValue - step );

  if ( _this->CurrentValue != oldValue )
  {
    if ( _this->Outlet.Object != 0 )
      EwOnSetInt32( _this->Outlet, _this->CurrentValue );

    EwNotifyRefObservers( _this->Outlet, 0 );
    EwIdleSignal( _this->OnChange, ((XObject)_this ));
  }
}

